import React, { Component } from 'react'
import "./index.css";
import 'antd/dist/antd.css';
class About extends Component {
    render() {
        return (
            <div className='container about'>
                <h1 className='center'>这是About页面</h1>
            </div>
        )
    }
}

export default About
